SELECT SUM("movie_info_idx"."movie_id") as agg_0, MIN("title"."episode_nr") as agg_1 FROM "name" LEFT OUTER JOIN "person_info" ON "name"."id" = "person_info"."person_id" LEFT OUTER JOIN "aka_name" ON "name"."id" = "aka_name"."person_id" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_info_idx" ON "title"."id" = "movie_info_idx"."movie_id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id"  WHERE "movie_info_idx"."info" NOT LIKE '%7.2%' AND "movie_info"."info" LIKE '%F%rench%' AND "title"."title" NOT LIKE '%an%d%' AND "cast_info"."note" NOT LIKE '%(archiv%e%' AND "movie_info"."movie_id" <= 1194331 AND "person_info"."person_id" IS NOT NULL AND "kind_type"."id" IS NOT NULL AND "movie_keyword"."movie_id" IS NOT NULL AND "char_name"."id" IS NOT NULL;
SELECT COUNT(*) as agg_0, SUM("char_name"."id") as agg_1 FROM "title" LEFT OUTER JOIN "kind_type" ON "title"."kind_id" = "kind_type"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "movie_info" ON "title"."id" = "movie_info"."movie_id"  WHERE "movie_keyword"."id" <= 1049543 AND ("kind_type"."kind" NOT LIKE '%seri%es%' OR "kind_type"."id" BETWEEN 3 AND 4) AND "char_name"."surname_pcode" LIKE '%M%5%' AND "title"."kind_id" >= 7 AND "title"."title" NOT LIKE '%d%e%' AND "movie_info"."movie_id" IS NOT NULL;
SELECT MAX("cast_info"."id") as agg_0 FROM "person_info" LEFT OUTER JOIN "name" ON "person_info"."person_id" = "name"."id" LEFT OUTER JOIN "aka_name" ON "name"."id" = "aka_name"."person_id" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id"  WHERE "person_info"."id" <= 1087633 AND ("name"."name" NOT LIKE '%Ad%ams,%' OR "name"."name" LIKE '%Baker,%') AND "title"."title" LIKE '%The%' AND "cast_info"."note" LIKE '%(uncredit%ed)%' AND "char_name"."id" BETWEEN 1205867 AND 2480963;
SELECT COUNT(*) as agg_0 FROM "movie_companies" LEFT OUTER JOIN "title" ON "movie_companies"."movie_id" = "title"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id"  WHERE "movie_companies"."note" LIKE '%(Japa%n)%' AND "title"."title" NOT LIKE '%Th%e%' AND ("movie_companies"."company_type_id" <= 1 OR ("movie_companies"."movie_id" >= 936255 AND "movie_companies"."company_type_id" BETWEEN 1 AND 2)) AND "movie_keyword"."movie_id" IS NOT NULL;
SELECT SUM("aka_name"."person_id") as agg_0, AVG("cast_info"."person_id") as agg_1 FROM "aka_name" LEFT OUTER JOIN "cast_info" ON "aka_name"."id" = "cast_info"."person_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id"  WHERE "char_name"."id" >= 2464920 AND "cast_info"."movie_id" <= 2193247 AND "cast_info"."nr_order" BETWEEN 1.3699178533802403 AND 16.082708129515556 AND "aka_name"."surname_pcode" NOT LIKE '%B%4%' AND "cast_info"."id" BETWEEN 11653582 AND 17169333 AND "char_name"."name_pcode_nf" NOT LIKE '%H5241%';
SELECT MAX("cast_info"."role_id") as agg_0, MAX("cast_info"."nr_order") as agg_1 FROM "char_name" LEFT OUTER JOIN "cast_info" ON "char_name"."id" = "cast_info"."person_role_id" LEFT OUTER JOIN "title" ON "cast_info"."movie_id" = "title"."id"  WHERE "char_name"."surname_pcode" NOT LIKE '%M5%' AND "cast_info"."person_id" BETWEEN 339335 AND 3876667 AND "title"."id" BETWEEN 1009962 AND 2320404 AND "char_name"."name" NOT LIKE '%Le%';
